    getPDFPath() {
      return axios.get('/lab/backend/files/123_11:26:00.pdf', {
        responseType: "blob"
      }).then(response => {
        console.log("Success", response);
        const blob = new Blob([response.data]);
        const objectUrl = URL.createObjectURL(blob);
